		h1{
			font-size: 36px;
			font-weight: bold;
			line-height: 1.1;
		}

		.buttons {
			margin: 25px 0;
		}

		.button, .button:visited {
			margin: 0 25px;
			padding: 15px 20px;

			display: inline-block;
			width: 120px;

			background-color: #EEEEEE;
			border: 1px solid #DDDDDD !important;
			border-radius: 3px;

			font-weight: bold;
		}

		.button:hover {
			border: 1px solid #AAAAAA;
		}

		@media screen and (max-width: 500px) {
			.button {
				margin: 25px  25px;
				display: block;
				width: auto;
			}
		}

		h1 small{
			color: #CC0000;

			font-size: 65%;
			font-weight: 400;
			line-height: 1;
		}

		footer{
			position: fixed;
			width: 100%;
			height: 40px;
			left: 0;
			bottom: 0;
		}

		a, a:visited {
			color: #222222;
			text-decoration: none;
			border-bottom: 1px dotted #999999;
		}

		a:hover {
			color: #AAAAAA;
			border-bottom: 1px dotted #AAAAAA;
		}
	</style>
</head>
